window.bookSummaryJSON = "<p><i>Supernatural </i>meets <i>The Boys</i>.</p> <p><b>Hemorrhoid cream commercials or monster hunting?</b></p> <p>He’s your average, struggling LA model just trying to book his next gig. When John finds out that the supernatural live among us, it's game on.</p> <p>Sign-twirling and rideshare-driving while waiting for his next casting call soon take a backseat to hunting the supernatural for a pretty penny.</p> <p>But not all is as straightforward as it may seem. There are those close to John who are more than they're letting on and that spells trouble for our reluctant hero - big trouble.</p> <p>For fans of Larry Correia's Monster Hunters International, Jim Butcher's Dresden Files, and M.D. Massey's Junkyard Druid comes your next romp in the graveyard.&nbsp;</p> <p><b>Buy the audiobook and start listening now!</b></p>"; 
